CREATE TABLE bio_taxons
(
    id        SERIAL
        PRIMARY KEY,
    dCreated  TIMESTAMP DEFAULT CURRENT_TIMESTAMP NULL,
    dUpdated  TIMESTAMP                            NULL,
    dDeleted  TIMESTAMP                            NULL,
    latin     varchar(255)                       NOT NULL,
	avibaseId varchar(255),
    type      varchar(15)                        NOT NULL,
    parentId  BIGINT                       NULL,
    CONSTRAINT latin
        UNIQUE (latin),
    CONSTRAINT bio_taxons_ibfk_1
        FOREIGN KEY (parentId) REFERENCES bio_taxons (id)
            ON UPDATE CASCADE ON DELETE SET NULL
);

CREATE INDEX parentId
    ON bio_taxons (parentId);

CREATE TABLE bio_taxons_locale
(
    id       SERIAL
        PRIMARY KEY,
    taxonId  BIGINT NOT NULL,
    title_en varchar(255) NULL,
    title_ru varchar(255) NULL,
    title_es varchar(255) NULL,
    CONSTRAINT bio_taxons_locale_ibfk_1
        FOREIGN KEY (taxonId) REFERENCES bio_taxons (id)
            ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE INDEX taxonId
    ON bio_taxons_locale (taxonId);


